def δ (x : ℕ) : ℕ :=
  let divisors := {d ∈ Finset.range (x + 1) | d ≠ 0 ∧ x % d = 0 ∧ d % 2 = 1}
  Finset.max' divisors ⟨1, Finset.mem_filter.mpr ⟨Finset.mem_range.mpr (nat.succ_le_succ (nat.zero_le x)), nat.one_ne_zero, nat.mod_one_eq_zero _, nat.one_mod_two_eq_one⟩⟩

def δ (x : ℕ) : ℕ := 
  if x = 0 then 0 else 
  Nat.findGreatest (λ d, d % 2 = 1 ∧ d ∣ x) x

def δ (x : ℕ) : ℕ :=
  let divisors := {d | d ∣ x ∧ d % 2 = 1}
  Finset.max' divisors (by simp [nat.exists_odd_factor])
